import React from 'react';
import * as Yup from 'yup';
import { Formik, Form } from 'formik';
import Button from '@mui/material/Button';
import utils from '../../utils/system/utils';
import FormikControl from '../../components/FormComp/FormikControl';


function CallCannonByDataFrom(props) {
    const initialValues = { 
        amount : '',
    };

    const validationSchema = Yup.object({
        amount : Yup.number().integer().min(1, 'הזן מספר גדול מ-0').required('שדה חובה'),
    });

    const onSubmit = async (values) => {
        // let res = await utils.addSystem(values);
        console.log(values);
    }

    return (
        <Formik
            initialValues={initialValues}
            validationSchema={validationSchema}
            onSubmit={onSubmit}
        >
            {
                formik => <Form>
                    <FormikControl 
                        control='input' 
                        type='number'
                        label='כמות דאטא' 
                        name='amount' 
                        size='small'
                        fullWidth
                        autoComplete='off'
                        />
                    <br/><br/>
                    <Button fullWidth type='submit' color='success'>הפעל</Button>
                </Form>
            }
        </Formik>
    );
}

export default CallCannonByDataFrom;
